import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{r,o as s,c as o,b as i,d as t,e as c,a}from"./app-a936711d.js";const d={},l=a('<h2 id="大厅内的操作" tabindex="-1"><a class="header-anchor" href="#大厅内的操作" aria-hidden="true">#</a> <strong>大厅内的操作</strong></h2><div class="hint-container info"><p class="hint-container-title">相关信息</p><ul><li>Enter回车 开关聊天框（可自定义热键），输入 /help 查看命令列表<br> 发表情 两个冒号中间夹着名字和数字 格式，如 :reimu1:<br> 详见Modules\\SokuLobbiesMod\\assets\\emotes\\list.json文件记录</li><li>Esc 退出大厅房间</li><li>按住A疾跑</li><li>在电梯前按Z进入</li></ul></div><figure><img src="https://bu.dusays.com/2023/08/06/64cf587bbf921.png" alt="表情文件" tabindex="0" loading="lazy"><figcaption>表情文件</figcaption></figure><div class="hint-container info"><p class="hint-container-title">大厅成就——预期完整版</p><p>赢十局：解锁角色形象<br> 输十局：解锁吃瘪表情<br> 把所有必杀卡和SC卡都用一遍：解锁角色形象的其他配色<br> 玩十局：解锁头衔称号 title（待更新）<br> 玩一百局：解锁accesory配饰（待更新）<br> 玩一千局：解锁背景（待更新）<br> 隐藏彩蛋：解锁恋恋等其他角色形象</p></div><h2 id="大厅内我和别人无法联机" tabindex="-1"><a class="header-anchor" href="#大厅内我和别人无法联机" aria-hidden="true">#</a> <strong>大厅内我和别人无法联机</strong></h2><h3 id="一、不支持ap-autopunch-联机" tabindex="-1"><a class="header-anchor" href="#一、不支持ap-autopunch-联机" aria-hidden="true">#</a> 一、不支持AP(AutoPunch)联机</h3><div class="hint-container warning"><p class="hint-container-title">注意</p><p>在使用和进入大厅，联机之前，你可以先检测你的网络环境支不支持AP联机，若不支持，可以使用Swarm中转联机【见下方 (/guide/FAQ/Play/LobbyGuide.html#二、如何使用-swarm-等中转ip在大厅里联机)】</p></div><figure><img src="https://bu.dusays.com/2023/08/06/64cf5b295d248.png" alt="运行“autopunch检测”" tabindex="0" loading="lazy"><figcaption>运行“autopunch检测”</figcaption></figure><figure><img src="https://bu.dusays.com/2023/08/06/64cf5c1042070.png" alt="支持" width="320" tabindex="0" loading="lazy"><figcaption>支持</figcaption></figure><figure><img src="https://bu.dusays.com/2023/08/06/64cf5c560e881.png" alt="不支持" width="320" tabindex="0" loading="lazy"><figcaption>不支持</figcaption></figure>',10),g={class:"hint-container info"},h=i("p",{class:"hint-container-title"},"相关信息",-1),p=i("p",null,[t("显示 "),i("strong",null,"Hole-punching is supported"),t(" 即为支持可用；"),i("br"),t(" 而 "),i("strong",null,"NOT supported"),t(" 即为不支持，不能在大厅内联机，请使用swarm和原版菜单。")],-1),u=i("strong",null,"【UDP 打洞 (UDP Hole Punching) 原理 - CSDN】",-1),f=i("br",null,null,-1),b={href:"https://blog.csdn.net/jsict/article/details/122828898",target:"_blank",rel:"noopener noreferrer"},m=a('<figure><img src="https://bu.dusays.com/2023/08/06/64cf5c9b4425f.png" alt="遇到类似这样的情况，重新多试几次，直到显示出结果" width="520" tabindex="0" loading="lazy"><figcaption>遇到类似这样的情况，重新多试几次，直到显示出结果</figcaption></figure><h3 id="二、如何使用-swarm-等中转ip在大厅里联机" tabindex="-1"><a class="header-anchor" href="#二、如何使用-swarm-等中转ip在大厅里联机" aria-hidden="true">#</a> 二、如何使用 Swarm 等中转IP在大厅里联机</h3><figure><img src="https://bu.dusays.com/2023/08/18/64de5a1b6da29.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container info"><p class="hint-container-title">使用说明</p><p><strong>通过服务器中转数据包的方式来帮助联机，只需要建主方打开软件即可，连接方无要求</strong><br><strong>打开Swarm和游戏的顺序无要求，可以开了游戏后再开swarm不影响</strong><br> 1、点更新服务器列表<br> 2、点<strong>中转</strong><br> 3、点<strong>复制</strong><br> 4、在 ini 配置内粘贴，<strong>按 Ctrl+S 保存</strong>，即可，不需要重开游戏。</p><ul><li><strong>注意不要改动10800的数字</strong></li></ul></div><figure><img src="https://bu.dusays.com/2023/08/18/64de5236aa100.png" alt="在天启上这里右键可以快捷打开 ini 配置文件" width="400" tabindex="0" loading="lazy"><figcaption>在天启上这里右键可以快捷打开 ini 配置文件</figcaption></figure><figure><img src="https://bu.dusays.com/2023/08/18/64de520a7a312.png" alt="在此修改，不要改动10800的数字" width="500" tabindex="0" loading="lazy"><figcaption>在此修改，不要改动10800的数字</figcaption></figure><div class="hint-container info"><p class="hint-container-title">相关信息</p><p><strong>服务器所在地区： 124——上海 ；159——广东 ；42——四川 ；152和101——北京</strong></p><p>实际延迟 ≈ 主机到服务器的距离 + 客机到服务器的距离</p><p>符合上述四个省份的可以无脑选自己所在省份，其他的人一般选用离得近的地区作为中转<br> 如果双方网络延迟过大，很有可能是绕了远路，可以检查联机双方的地区来选择合适的中转服务器</p><p>中转一般选“标准模式”，wifi对局可尝试使用“玄学模式”（效果不会太大）<br> 左下角配置可以修改链接端口，默认10800，一般不需要修改，<br> 勾选修复端口地址以允许观战</p></div><h3 id="三、可能是版本问题" tabindex="-1"><a class="header-anchor" href="#三、可能是版本问题" aria-hidden="true">#</a> 三、可能是版本问题</h3><figure><img src="https://bu.dusays.com/2023/08/06/64cf59355a97c.png" alt="检查游戏标题" tabindex="0" loading="lazy"><figcaption>检查游戏标题</figcaption></figure><figure><img src="https://bu.dusays.com/2023/08/06/64cf5aa78a42c.png" alt="版本问题报错" tabindex="0" loading="lazy"><figcaption>版本问题报错</figcaption></figure><div class="hint-container info"><p class="hint-container-title">相关信息</p><p>联机时显示这种四行红字报错提示，意思是双方版本不一致<br> Your version一行是你自己的版本，图中 GiuRoll with SWR 的意思是60F版本giuroll + 绯想天合体，<br> Their version一行是对方的版本，图中GiuRoll-62FPS with SWR的意思是62F版本giuroll + 绯想天合体<br> with SWR就说明是和绯想天合体成功的；without SWR就说明是没和绯想天合体成功。<br> 检查并更新游戏版本，注意CN代表的62F，与不加CN的60F之间不能互相联机。</p></div><h2 id="点创建大厅提示这个是什么意思" tabindex="-1"><a class="header-anchor" href="#点创建大厅提示这个是什么意思" aria-hidden="true">#</a> <strong>点创建大厅提示这个是什么意思</strong></h2><figure><img src="https://bu.dusays.com/2023/08/08/64d233d146e89.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container warning"><p class="hint-container-title">注意</p><p><strong>玩家请点加入大厅</strong><br> 创建大厅需要公网IP，使用文件夹内的RunServer.bat</p></div><h2 id="大厅房间进不去-卡加载loading" tabindex="-1"><a class="header-anchor" href="#大厅房间进不去-卡加载loading" aria-hidden="true">#</a> <strong>大厅房间进不去，卡加载loading</strong></h2><figure><img src="https://bu.dusays.com/2023/08/06/64cf55b644ff8.png" alt="" width="500" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container info"><p class="hint-container-title">解决办法</p><p>重开游戏(</p></div><h2 id="进入大厅或者菜单里点自定义形象就崩溃" tabindex="-1"><a class="header-anchor" href="#进入大厅或者菜单里点自定义形象就崩溃" aria-hidden="true">#</a> <strong>进入大厅或者菜单里点自定义形象就崩溃</strong></h2><p><img src="https://bu.dusays.com/2023/08/06/64cf5741976d0.png" alt="报错" width="440" loading="lazy"> <img src="https://bu.dusays.com/2023/08/06/64cf57e8457e4.png" alt="" width="420" loading="lazy"></p><div class="hint-container info"><p class="hint-container-title">解决办法</p><p><strong>解决办法：</strong> 看图中文件夹路径 <code>th123/modules/SokuLobbiesMod</code> 文件夹内，删除你的<code>settings.dat</code> 或 <code>stats.dat</code></p></div><h2 id="这个报错弹窗是什么意思-我被踢出房间了" tabindex="-1"><a class="header-anchor" href="#这个报错弹窗是什么意思-我被踢出房间了" aria-hidden="true">#</a> <strong>这个报错弹窗是什么意思，我被踢出房间了</strong></h2><figure><img src="https://bu.dusays.com/2023/08/06/64cf58d497d26.png" alt="" width="300" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container info"><p class="hint-container-title">相关信息</p><p>这个正常，也没办法，冷不丁抽风来一下，被踢就算了，过会儿等他刷新再进就是了。</p></div><h2 id="我有些人可以观战-但是有些人却观战不了" tabindex="-1"><a class="header-anchor" href="#我有些人可以观战-但是有些人却观战不了" aria-hidden="true">#</a> <strong>我有些人可以观战，但是有些人却观战不了</strong></h2><div class="hint-container info"><p class="hint-container-title">相关信息</p><p>回答：<strong>正常。</strong></p></div><h2 id="选人界面这个对话框怎么关掉" tabindex="-1"><a class="header-anchor" href="#选人界面这个对话框怎么关掉" aria-hidden="true">#</a> <strong>选人界面这个对话框怎么关掉</strong></h2><figure><img src="https://bu.dusays.com/2023/08/06/64cf5d0492199.png" alt="" width="520" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container info"><p class="hint-container-title">相关信息</p><p>选人界面会显示不会消失，不用理它，选完地图进入对战就会消失了<br> 如果会键入打字，那就按回车把字输出就行了，然后就不会再打字了。</p></div><h2 id="建主或进别人时提示-bind-弹窗-我进去大厅发现已经有一个我-然后自己的id后面多了个0" tabindex="-1"><a class="header-anchor" href="#建主或进别人时提示-bind-弹窗-我进去大厅发现已经有一个我-然后自己的id后面多了个0" aria-hidden="true">#</a> <strong>建主或进别人时提示“bind”弹窗，我进去大厅发现已经有一个我，然后自己的ID后面多了个0</strong></h2><figure><img src="https://bu.dusays.com/2023/08/06/64cf5d4a57684.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><div class="hint-container info"><p class="hint-container-title">解决办法</p><p>这是因为你之前的则刚好卡死崩溃黑屏等，此时关掉窗口并不会实际关闭游戏，游戏进程th123.exe依然残留在电脑中</p><p><strong>解决办法:</strong> 右键任务栏打开任务管理器，进程页面，英文输入法按T，可定位th123.exe，检查游戏是不是有残留进程，结束掉（小心别结束掉现在在玩的游戏进程）</p><p>我怎么开任务管理器？<br> 最底下任务栏空白处，右键就能找到了；或者按快捷键Ctrl+Shift+ESC。不要按Ctrl+Alt+Delete，会让游戏崩溃。</p></div><h2 id="进入大厅后过一段时间-整个游戏就会变成ppt-退出大厅也依然很卡" tabindex="-1"><a class="header-anchor" href="#进入大厅后过一段时间-整个游戏就会变成ppt-退出大厅也依然很卡" aria-hidden="true">#</a> 进入大厅后过一段时间，整个游戏就会变成PPT，退出大厅也依然很卡</h2><div class="hint-container warning"><p class="hint-container-title">注意</p><p>现在碰到有3个人报告遇到这个问题，<br> 目前不知道原因，也没有解决办法，只能不进去大厅里面。</p><p><strong>有一人说换用旧版WindowResizer-old有效，可以试试先</strong></p><p>遇到这种问题的朋友，请尝试只开大厅这一个mod，然后看还有没有掉帧情况，并与三回联系（QQ 1434716883）</p></div>',33);function y(x,v){const n=r("ExternalLinkIcon");return s(),o("div",null,[l,i("div",g,[h,p,i("p",null,[u,f,i("a",b,[t("https://blog.csdn.net/jsict/article/details/122828898"),c(n)])])]),m])}const z=e(d,[["render",y],["__file","LobbyGuide.html.vue"]]);export{z as default};
